import React, { Fragment } from "react";
import "./App.css";
import { publicRoutes, privateRoutes } from "./Routes";
import { Routes, Redirect } from "react-router-dom";
import { Route } from "react-router";
import Login from "./Pages/Login/Login";
import ForgotPassword from "../Pages/ForgotPassword/ForgotPassword";
import Articles from "../Pages/Articles/Articles";

const App = () => {
  const LoginContainer = () => (
    <div className="container">
      <Route exact path="/" render={() => <Redirect to="/login" />} />
      <Route path="/login" component={Login} />
    </div>
  );

  const DefaultContainer = () => (
    <div>
      <div className="container">
        <h1> Navbar</h1>
        <Route path="/main" component={Main} />
        <Route path="/user" component={User} />
        <Route path="/hw-setting" component={Setting} />
        <Route path="/hw-detail/:id" component={HwDetail} />
        <Route path="/gas-detail/:id" component={GasDetail} />
        {this.state.isAlertOpen ? <Alert /> : null}
      </div>
    </div>
  );
  return (
    <div className="App">
      <Routes>
        {publicRoutes.map((route, idx) => (
          <Route path={route.path} element={<route.component />} key={idx} />
        ))}
        <>
          <Route element={<h1>Navbar</h1>}>
            {privateRoutes.map((route, idx) => (
              <Route
                path={route.path}
                element={<route.component />}
                key={idx}
              />
            ))}
          </Route>
        </>
      </Routes>
    </div>
  );
};

export default App;
